import './StudentID.css'
import image from '../../Data/Arrow2.svg'


const StudentID = () => {
    return(
        <div className={'StudentID'}>
            <header className={'Header'}>
                <button><img src={image}/>학생 목록 페이지로</button>
            </header>
        </div>

    );
}

export default StudentID
